function criarmateriais(){

    var tipo_lista = localStorage.getItem("tipolista");

    for (i = 0;i <= materiais.length - 1;i++){
        var material_cod        =   materiais[i].codigo;
        var material_desc       =   materiais[i].descricao;
        var material_tipo       =   materiais[i].tipo;

        if(material_tipo === tipo_lista){
            tabela = document.getElementById('lista_criar').innerHTML;

            document.getElementById('lista_criar').innerHTML = tabela +
            "<tr>" + 
            "<td class='codigo'>" + material_cod + "</td>" + 
            "<td>" + material_desc.replace(/_/g," ") + "</td>" + 
            "</tr>"
        };
    };
};



